import Layout from '../Components/Layout';

const Forms = () => (
    <form>
    <input id="country" type="text" name="country" placeholder="  Country..." required />
    <button id="myButton">Get CountryInfo</button>



    <style jsx>{`
    #country{
        width: 300px;
    }
    #country:hover{
        -webkit-transform: scale(0.95);-moz-transform: scale(0.95);-ms-transform: scale(0.95);transform: scale(0.95);

    }

    #myButton{
        background: #08e;
        height: 40px;
        border: 1px solid lightgray;
        border-radius: 5px;
        font-size: 15px;
        width: 120px;
    }
    #myButton:hover{
        background: #333;
        color: white;
    }
    
    `}</style>


    
    
    

    </form>


   
);
export default Forms;
